ReutersLGBTQ couple Vorawan 'Beaut' Ramwan and Anticha 'An' Sangcha pose for a picture after receiving official marriage certificates, as the country's marriage equality bill comes into effect following a royal endorsement which effectively makes Thailand Asia's third territory to legalise same-sex unions, in Bangkok, Thailand, January 23, 2025. REUTERS/Chalinee ThirasupaThailand has taken a significant step toward equality by legalizing same-sex marriage on January 23, 2025. This decision makes Thailand the first country in Southeast Asia to recognize marriage equality, joining Taiwan and Nepal as the third nation in Asia to pass such legislation. The landmark move was met with celebrations across the country, marking a new chapter for LGBTQ+ rights in the region.
